verify_msg(Msg) when tuple_size(Msg) >= 1 -> verify_msg(Msg, element(1, Msg), []);
verify_msg(X) -> mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName) when is_atom(MsgName) -> verify_msg(Msg, MsgName, []);
verify_msg(Msg, Opts) when tuple_size(Msg) >= 1 -> verify_msg(Msg, element(1, Msg), Opts);
verify_msg(X, _Opts) -> mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        'PlayerState' -> v_msg_PlayerState(Msg, [MsgName], TrUserData);
        'ClientToServer' -> v_msg_ClientToServer(Msg, [MsgName], TrUserData);
        'ServerToClient' -> v_msg_ServerToClient(Msg, [MsgName], TrUserData);
        'Ghost' -> v_msg_Ghost(Msg, [MsgName], TrUserData);
        'Ghosts' -> v_msg_Ghosts(Msg, [MsgName], TrUserData);
        'PlayerUpdate' -> v_msg_PlayerUpdate(Msg, [MsgName], TrUserData);
        'ChatMessage' -> v_msg_ChatMessage(Msg, [MsgName], TrUserData);
        'RideOn' -> v_msg_RideOn(Msg, [MsgName], TrUserData);
        'SegmentComplete' -> v_msg_SegmentComplete(Msg, [MsgName], TrUserData);
        _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


